AnalogValue advanced_key_normalize(AdvancedKey* advanced_key, AnalogValue value)
{
    const uint16_t length = sizeof(table) / sizeof(table[0]);
#ifndef ENABLE_FIXED_POINT_EXPERIMENTAL
#ifdef OPTIMIZE_FOR_FLOAT_DIVISION
    float x = (advanced_key->config.upper_bound - value) * advanced_key->range_reciprocal;
#else
    float x = (advanced_key->config.upper_bound - value) / (float)(advanced_key->config.upper_bound - advanced_key->config.lower_bound);
#endif
    int16_t index = x * length;
#else
    int16_t index = (advanced_key->config.upper_bound - value) * length / (advanced_key->config.upper_bound - advanced_key->config.lower_bound);
#endif
    if (index < 0)
    {
        index = 0;
    }
    if (index >= length)
    {
        index = length - 1;
    }
    return table[index] + ANALOG_VALUE_MIN;
}

void keyboard_scan()
{
    keyboard_key_update(&KEY_FN_K1, FN_K1_READ);
    keyboard_key_update(&KEY_FN_K2, FN_K2_READ);
    keyboard_key_update(&KEY_FN_K3, FN_K3_READ);
    keyboard_key_update(&KEY_FN_K4, FN_K4_READ);
    keyboard_key_update(&KEY_FN_K5, FN_K5_READ);
    keyboard_key_update(&KEY_FN_K6, FN_K6_READ);
    keyboard_key_update(&KEY_KNOB, KNOB_READ);
}
void keyboard_reboot()
{
    //__set_FAULTMASK(1);
    __disable_irq();
    NVIC_SystemReset();
}
void keyboard_delay(uint32_t ms)
{
    Delay_Ms(ms);
}

void keyboard_user_event_handler(KeyboardEvent event)
{
    if (event.event != KEYBOARD_EVENT_KEY_DOWN)
    {
        return;
    }
    switch (KEYCODE_GET_SUB(event.keycode))
    {
    case USER_OPENMENU:
        fezui_page_t* launcherpage_get_current_page();
        if (launcherpage_get_current_page() == &homepage)
        {
            void launcherpage_open_menu();
            launcherpage_open_menu();
            layer_reset(0);
            layer_reset(1);
            layer_reset(2);
            layer_reset(3);
            layer_reset(4);
        }
        break;
    case USER_SNAKE_LAUNCH:
        snake_launch(&g_snake);
        break;
    case USER_SNAKE_QUIT:
        snake_quit(&g_snake);
        break;
    case USER_SNAKE_PAUSE:
        snake_pause(&g_snake);
        break;
    case USER_SNAKE_SPEED_UP:
        snake_speed_up(&g_snake);
        break;
    case USER_SNAKE_SPEED_DOWN:
        snake_speed_down(&g_snake);
        break;
    case USER_SNAKE_RESTART:
        snake_restart(&g_snake);
        break;
    case USER_SNAKE_LEFT:
    case USER_SNAKE_UP:
    case USER_SNAKE_RIGHT:
    case USER_SNAKE_DOWN:
        snake_turn(&g_snake, KEYCODE_GET_SUB(event.keycode)&0x07);
        break;
    default:
        g_keyboard_config.debug = false;
        break;
    }
}


